import { useState, useEffect } from 'react';
import { Link, useParams } from 'react-router-dom';



const handleBuyCourse = async (hour, length, day, number, newType) => {
    let courseType = '';
    switch (newType) {
        case 'math1': 
            newType = 'Matematyka szkoła podstawowa'; 
            break;
        case 'math2': 
            courseType = 'Matematyka liceum podstawa'; 
            break;
        case 'math3': 
            courseType = 'Matematyka liceum rozszerzenie'; 
            break;
        case 'physics1': 
            courseType = 'Fizyka szkoła podstawowa'; 
            break;
        case 'physics2': 
            courseType = 'Fizyka liceum podstawa'; 
            break;
        case 'physics3': 
            courseType = 'Fizyka liceum roszerzenie'; 
            break;
        default: 
            courseType = 'Korepetycje';
            break;
    }

    console.log('type: ', courseType);

    const data = {
        hour, 
        length, 
        day, 
        number,
        courseType,
    }

    try {
        const res = await fetch('/meetingDetails', {
            method: 'POST',
            body: JSON.stringify(data),
            headers: { 'Content-Type': 'application/json' }
        });
    }
    catch (err) {
        console.log(err);
    }
}

const displayHours = (weekday, readyHours, setHour) => {
    let weekdayArray;
    switch(weekday) {
        case 'monday':
            weekdayArray = readyHours.monday;
            break;
        case 'thuesday':
            weekdayArray = readyHours.thuesday;
            break;
        case 'wednesday':
            weekdayArray = readyHours.wednesday;
            break;
        case 'thursday':
            weekdayArray = readyHours.thursday;
            break;
        case 'friday':
            weekdayArray = readyHours.friday;
            break;
    }

    let array;
    if(weekdayArray == undefined) {
        array = <option value="no-options-available">No options available</option>
    } else {
        array = weekdayArray.map((element) => {
            return (
                <option value={element}>{element}</option>
            )
        })
    }

    return (
        <select id="hour" name="hour" onChange={(event) => {setHour(event.target.value)}}>
            {array}
        </select>
    )
}



export default function MeetingDetails() {
    const { courseType } = useParams();

    const [ readyHours, setReadyHours ] = useState([]);
    const [ userData, setUserData ] = useState([]);
    const [ hour, setHour ] = useState('18:00');
    const [ length, setLength ] = useState('45min');
    const [ day, setDay ] = useState('Pon');
    const [ number, setNumber ] = useState('1');

    useEffect(() => {
        fetch('/main/api/data')
            .then((res) => res.json())
            .then((res) => setUserData(res))


            // NEW INCOMPLETED FETCH!!!
        fetch('/getReadyHours/data')
            .then((res) => res.json())
            .then((res) => setReadyHours(res))
    }, [])





    // DO DOKONCZENIA!!!


    setReadyHours(prev => {
        let lengthNumber = 0;
        switch(length) {
            case '45min':
                lengthNumber = 3;
                break;
            case '60min':
                lengthNumber = 4;
                break;
            case '75min':
                lengthNumber = 5;
                break;
            case '90min':
                lengthNumber = 6;
                break;
            default: 
                break;
        }
        
        const mondayArray = prev.monday;
        const thuesdayArray = prev.thuesday;
        const wednesdayArray = prev.wednesday;
        const thursdayArray = prev.thursday;
        const fridayArray = prev.friday;

        let newMonday = [], newThuesday = [], newWednesday = [], newThursday, newFriday;

        // DOSTEPNE KURSY
        if(mondayArray != undefined) {
            for(let i = 0; i < mondayArray.length - lengthNumber; i++){
                let available = true;
                for(let j = 0; j < lengthNumber; j++){
                    if(mondayArray[i + j].numberOfAvailable == 0){
                        available = false;
                    }
                }
                if(available){
                    newMonday.push(mondayArray[i].hour);
                }
            }
            for(let i = 0; i < thuesdayArray.length - lengthNumber; i++){
                let available = true;
                for(let j = 0; j < lengthNumber; j++){
                    if(thuesdayArray[i + j].numberOfAvailable == 0){
                        available = false;
                    }
                }
                if(available){
                    newThuesday.push(thuesdayArray[i].hour);
                }
            }
            for(let i = 0; i < wednesdayArray.length - lengthNumber; i++){
                let available = true;
                for(let j = 0; j < lengthNumber; j++){
                    if(wednesdayArray[i + j].numberOfAvailable == 0){
                        available = false;
                    }
                }
                if(available){
                    newWednesday.push(wednesdayArray[i].hour);
                }
            }
            for(let i = 0; i < thursdayArray.length - lengthNumber; i++){
                let available = true;
                for(let j = 0; j < lengthNumber; j++){
                    if(thursdayArray[i + j].numberOfAvailable == 0){
                        available = false;
                    }
                }
                if(available){
                    newThursday.push(thursdayArray[i].hour);
                }
            }
            for(let i = 0; i < fridayArray.length - lengthNumber; i++){
                let available = true;
                for(let j = 0; j < lengthNumber; j++){
                    if(fridayArray[i + j].numberOfAvailable == 0){
                        available = false;
                    }
                }
                if(available){
                    newFriday.push(fridayArray[i].hour);
                }
            }
        }

        return { monday: [...newMonday], thuesday: [...newThuesday], wednesday: [...newWednesday], thursday: [...newThursday], friday: [...newFriday] }
        
    })



    // KONIEC STREFY DO DOKONCZENIA



    return (
        <div className="meeting-details-page">
            <div className="meeting-details-navbar">
                <Link to="/main"><img className="home-image" src="../images/home.png" alt="home page" /></Link>
                <div className="username">{userData.name} {userData.surname}</div>
            </div>
            <div className="meeting-page-main">
                <div className="meeting-page-options">
                    <div className="details-title">Detale zajęć</div>
                    <div className="meeting-main">
                        <div className="meeting-main-box">
                            <div className="details-hour">Godzina</div>
                            {displayHours(day, readyHours, setHour)}
                        </div>
                        <div className="meeting-main-box">
                            <div className="details-hour">Długość</div>
                            <select id="hour" name="hour" onChange={(event) => {setLength(event.target.value)}}>
                                <option value="45min">45min</option>
                                <option value="60min">60min</option>
                                <option value="75min">75min</option>
                                <option value="90min">90min</option>
                            </select>
                        </div>
                        <div className="meeting-main-box">
                            <div className="details-hour">Dzień tygodnia</div>
                            <select id="hour" name="hour" onChange={(event) => {setDay(event.target.value)}}>
                                <option value="Poniedziałek">Poniedziałek</option>
                                <option value="Wtorek">Wtorek</option>
                                <option value="Środa">Środa</option>
                                <option value="Czwartek">Czwartek</option>
                                <option value="Piątek">Piątek</option>
                            </select>
                        </div>
                    </div>
                </div>
                <div className="meeting-page-buying-section">
                    <div className="meeting-page-left">
                        <div className="meeting-page-buying-text">Liczba wykupywanych zajęć:</div>
                        <div className="meeting-main-box">
                            <select id="buying-courses-count" name="buying-courses-count" onChange={(event) => {setNumber(event.target.value)}}>
                                <option value="1">1</option>
                                <option value="4">4</option>
                                <option value="10">10</option>
                                <option value="20">20</option>
                            </select>
                        </div>
                    </div>
                    <Link to="/main"><div className="meeting-page-right" onClick={() => {handleBuyCourse(hour, length, day, number, courseType)}}>Kup zajęcia</div></Link>
                </div>
            </div>
        </div>
    )
}
